import React from 'react';

const OptionButton = ({ option, onClick }) => {
  const handleClick = () => {
    onClick(option); // Call the onClick function with the selected option
  };

  return (
    <button className="option-box" onClick={handleClick}>
      {option}
    </button>
  );
};

export default OptionButton;
